import React from "react";
import './GoalsList.css';

const GoalsList = props => {
  console.log(props.goals);
  return (
    <div className="goals-list">
      <p>Your current goals</p>
      <ul>{[<li>Hi</li>, <li>This works</li>]}</ul>
    </div>
  );
};

export default GoalsList;
